import React, { Component } from 'react'
import { connect } from 'react-redux';
import AProject from './Project';
import "../../Css/AsClient.css"
import Spinner from '../../Spinner.js'

class AsClient extends Component {

     componentWillReceiveProps(nextProps){
            if(nextProps.project){
                this.setState({
                    project: nextProps.project,
                    auth: nextProps.auth

                });
            }
     }
    
    render() {
        const { clientProject,loading } = this.props.project;
         const { user } = this.props.auth;
         
    let Allprojects;

    if (clientProject === null || loading) {
      Allprojects = <Spinner />;
    } else {
      Allprojects = <AProject project={clientProject} user={user}/>;
    }
        
          
     

     
        return (
            <div>
                {Allprojects}
            </div>
        )
    }
}


const mapStateToProps = (state) => ({
  project: state.project,
  auth: state.auth
});
export default connect(mapStateToProps, {    })(AsClient);
